import { CREATE_PROJECT } from '../types/projectTypes';

export const createNewProject = project => {
    return {
        type: CREATE_PROJECT,
        payload: project
    }
}

export const createProject = () => {
    return (dispatch, getState) => {
        // make async
        dispatch(createNewProject);
    }
}
